import React from "react";
import style from "./PageHeader.module.scss";

const PageHeader = ({ title }) => {

    return (
        <div className={style.headerOuterDiv}>
            <div className={style.logoDiv}>
                <h2>
                    RL CREATIONS
                </h2>
            </div>
        </div>
    )
}

export default PageHeader;
